    [],nt"num_tags": 4,nt"name": "crab-orchard-national-wildlife-refuge-annual-narrative-report-calendar-year-1978",nt"isopen":
    false,nt"url": null,nt"notes": "This annual narrative report for Crab Orchard
    National Wildlife Refuge outlines Refuge accomplishments during the 1978 calendar
    year. The report begins by describing the climate and habitat conditions in the
    Refuge, as well as the land acquisition program and system status. The construction
    and maintenance section describes physical developments, maintenance, and wildfires.
    The habitat management section discusses grasslands, croplands, wetlands, forest
    lands, and wilderness and special areas. Wildlife- including migratory birds, big
    game animals, and raptors- are discussed. The public relations sections describes
    recreational uses and enforcement. Items of interest and photographs are attached.",nt"owner_org":
